import { Link } from "react-router-dom";
import React, { useEffect } from "react";
import "./styles.css"

export const Data = () => {
    const [data, setData] = React.useState([]);
    useEffect(() => {
        const fetchData = async () => {
            const response = await fetch("http://localhost:3001/data");
            const data = await response.json();
            setData(data);
        }
        fetchData();
    }, []);
    return (
        <>
            <Link style={{ fontSize: "30px", color: "orange", padding: "20px" }} to="/">Home</Link>
            <table class="table table-hover" style={{ color: "orange", backgroundColor: "white" }}>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Age</th>
                        <th>Blog content</th>
                        <th>blog</th>
                        <th>id</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        data.map((item) => {
                            return (
                                <tr scope="row">

                                    <td>{item.name}</td>
                                    <td>{item.age}</td>
                                    <td>{item.study}</td>
                                    <td>{item.blog}</td>
                                    <td>{item.id}</td>
                                </tr>
                            )
                        })
                    }
                </tbody>
            </table>
        </>
    );
}
